import React, { Component } from "react";

class HogInfo extends Component {
  render() {
    return (
      <div>
        <ul>
          <li>{this.props.hogInfo.specialty}</li>
        </ul>
        <p>{this.props.hogInfo.name}</p>
      </div>
    );
  }
}

export default HogInfo;
